import React from 'react';
import { Trans } from 'react-i18next';
import css from './PageTitle.module.css';

export const PageTitle = ({ text }: { text: string }) => {
  return (
    <>
      <Trans>
        <h1 className={css.title}>{text}</h1>
      </Trans>
    </>
  );
};
